            no. 182 (Apr. 1961)- by: U.S. Department of Agriculture, Economic Research
            Service.

Text portion merged with: Agricultural outlook digest; Demand and price situation;
            and: Marketing and transportation situation; to form: Agricultural outlook (Washington,
            D.C. : 1975).

